</h1>
<div class="Section6"><br><b>ToolBar </b>est un gestionnaire de barre d'outils. Il permet de personnaliser la barre d'outils d'un projet Android.
<br><br><span class="GText2" style="
color: #00ff00;
">// MainActivity.java (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="java" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
public class MainActivity extends AppCompatActivity {
    private ActivityMainBinding binding;
    private final String[] m_titles = {"Accueil", "Cours", "Tutoriels", "Applications"};
    private int m_count = 0;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        binding = ActivityMainBinding.inflate(getLayoutInflater());
        setContentView(binding.getRoot());
        setSupportActionBar(binding.toolBar);
        Objects.requireNonNull(getSupportActionBar()).setTitle(m_titles[m_count]);

        binding.btnRun.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                if(++m_count &gt;= m_titles.length) {
                    m_count = 0;
                }
                Objects.requireNonNull(getSupportActionBar()).setTitle(m_titles[m_count]);
            }
        });
    }
}
...</pre><br>L'espace de noms (<b>res-auto</b>) est utilisé pour définir les vues personnalisées dans un projet Android.&nbsp;<br><br><span class="GText2" style="
color: #00ff00;
