</h1>
<div class="Section6"><br><b>DrawerLayout </b>est un gestionnaire de contenu de niveau supérieur. Il permet de basculer plus facilement entre les différentes vues d'un projet Android.<br><br><span class="GText2" style="
color: #00ff00;
">// Android Studio (Créer un projet Navigation Drawer Views Activity)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le menu nouveau projet
Menu &gt; File &gt; New &gt; Project
# Sélectionner le type d'activité
Phone and Tablet &gt; Navigation Drawer Views Activity
Next
# Définir les informations du projet
Name &gt; rdv_android
Package name &gt; com.ready.app
Save location &gt; v01
Language &gt; Java
Minimum SDK &gt; API 24 ("Nougat"; Android 7.0)
Build configuration language &gt; Kotlin DSL (build.gradle.kts)[Recommended]
Finish
